'''天月-あまつき-'''是在[[niconico动画]]上活跃且人气很高的唱见之一。

== 个人介绍 ==

*天月-あまつき-是[[niconico动画]]上一位男性唱见，擅长高音。

*天月-あまつき-主要翻唱[[VOCALOID]]歌曲和[[ACG]]歌曲，也有自己的原创曲和V家歌曲。第一次在N站上投稿是在2008年08月09，在2018年7月18日第一次投稿V家曲（sm33546188）。

*天月-あまつき-希望自己是个大帅哥但本身长得就很好看，因为反复折腾发色所以发质不好。虽然说自己还没有颜出开始推特上的自拍和露脸的视频都没有打码。

*天月-あまつき-是活泼的少年音。早期的声线和现在差不多。

*天月-あまつき-朋友很多，不论是圈内圈外的朋友都一致认为天月是最正常的唱见，经常和其他唱见合作，如[[伊东歌词太郎]](甘党加湿器)，[[まふまふ]](闺蜜组)，[[96猫]](天猫)。

*天月-あまつき-2014年7月16日以KINGRECORD公司旗下歌手身份正式出道，并发售第一张个人主导专辑「Hello,World!」。。

*天月-あまつき-很喜欢小动物，有很多宠物，家里有一只养很久的猫咪叫りん，还有一只没有养很久的小狗叫ルア。

*天月-あまつき-的二次元设定是茶色的少年，穿着卫衣和带着酒红色的{{黑幕|被ルア咬过的}}针织帽，也知道和[[夏代孝明]]撞设定了并表示要决个斗。

== 个人信息 ==
[[File:Zhengzong.jpg|thumb|right|100px|正宗]]
*有时会戴眼镜，本人说是为了让脸看起来小一点，视力是正常的。在live上过嗨了会把眼镜丢出去所以阵亡了好多眼镜。

*会自己作词作曲，很喜欢写青春的恋爱曲子，但是在平时谈到恋爱方面会变得很sad，最近的mv和推特的视频上开始跳舞了，专用mix：[[kain]]。

*和[[まふまふ|mafumafu]]的关系很好以至于相爱相杀<del>塑料姐妹花</del>，也会在mafu需要帮忙的时候给予最大帮助，比如在mafu看恐怖视频后半夜睡不着安慰他。

*开在niconico投稿早期体重一路飙升直到某次演唱会上穿了[[伊东歌词太郎]]的裤子后感到很紧开始减肥，方法是半夜去跑步，直到现在体重下降到过瘦的程度。

*身高176cm(好像长高了1cm)，A型血，不喜欢吃蔬菜，对花粉和荞麦过敏吉祥物是正宗。

